form.addEventListener('submit', (e) => {
    e.preventDefault()
})


player_input.addEventListener('keyup', (e) => {

    let input_value = e.target.value
    let results = []
    if (input_value.length) {
        results = names.filter((item) => {
            return item.toLowerCase().includes(input_value.toLowerCase())
        })
    }

    if (results.length >= 10) {
        renderResults(results.slice(0,10))
    } else {
        renderResults(results)
    }

    window.addEventListener('keyup', (key) => {
        if (key.keyCode === 13) {
            let searchResults = document.querySelectorAll('.searchResult')
            if ( searchResults.length !== 0 ) {
                player_input.value = searchResults[0].textContent.toLowerCase()
                form.submit()
            }
        }
    })
})

function renderResults(results) {
    suggestiosn.innerHTML = ""
    
    if (!results.length) {
        suggestiosn.classList.remove('show')
        return ''
    }

    for (var i = 0; i < results.length; i++) {
        var li  = document.createElement('li')
        li.className = 'searchResult'
        li.textContent = results[i]
        suggestiosn.append(li)

    }

    var searchResults = document.querySelectorAll(".searchResult")

    searchResults.forEach((li) => {

        li.addEventListener('click', () => {
            player_input.value = li.textContent
            form.submit()
        })
    })


    suggestiosn.classList.add('show')
}

